import React from 'react';
import { Container, Row, Col, Button } from 'react-bootstrap';

const InfoSection = () => {
  return (
    <Container className="bg-white rounded shadow-sm py-3 mt-5">
      <Row className="text-center">
        <Col md={4} className="d-flex flex-column align-items-center">
          <i className="bi bi-geo-alt-fill mb-2"></i>
          <h5>Местоположение</h5>
          <p className="text-muted">гр.Варна</p>
        </Col>
        <Col md={4} className="d-flex flex-column align-items-center">
          <i className="bi bi-clock-fill mb-2"></i>
          <h5>Работно време</h5>
          <p className="text-muted">От Пон. до Петък/12:00-20:00</p>
        </Col>
        <Col md={4} className="d-flex flex-column align-items-center">
          <i className="bi bi-telephone-fill mb-2"></i>
          <h5>Потвърждения</h5>
          <p className="text-muted">До 24 часа</p>
        </Col>
      </Row>
      <Row className="justify-content-center mt-3">
        <Button variant="primary">НАУЧИ ПОВЕЧЕ</Button>
      </Row>
    </Container>
  );
};

export default InfoSection;
